import React, { useEffect, useState } from 'react';
import './App.css';
import  { Button, Card } from 'react-bootstrap';
import { User} from './Model/UserModel';
import {Unknown} from './Model/UnknownModel';
import UserComponent from './components/UserComponent';
import UnknownComponent from './components/UnknownComponent';

import ListComponent from './components/ListComponent';

const loadUser = async (url: string): Promise<User> => {
  const response = await fetch(url);
  const user = response.status == 404
    ? null
    : await response.json();
  return user as User;
}

const loadUnknown = async (url: string): Promise<Unknown> => {
  const response = await fetch(url);
  const user = response.status == 404
    ? null
    : await response.json();
  return user as Unknown;
}

function App(): JSX.Element {

  const [user1, setUser1] = useState<User | null>(null);
  const [user2, setUser2] = useState<User | null>(null);
  const [unknown1, setunknown1] = useState<Unknown | null>(null);
  const [unknown2, setunknown2] = useState<Unknown | null>(null);


  useEffect(() =>{
    const initialize = async () => {
      const loadedUser1 = await loadUser("https://reqres.in/api/users/2");
      setUser1(loadedUser1); 
      const loadedUser2 = await loadUser("https://reqres.in/api/users/23");
      setUser2(loadedUser2);
      const loadedUnknown1 = await loadUnknown('https://reqres.in/api/unknown/2');
      setunknown1(loadedUnknown1);
      const loadedUnknown2 = await loadUnknown('https://reqres.in/api/unknown/23');
      setunknown2(loadedUnknown2);
    }
    initialize();
    return () => {

    }
  }, [])


  useEffect(() =>{
    console.log("User1 changed");
  }, [user1])

  useEffect(() =>{
    console.log("User2 changed");
  }, [user2])
  const arr =[1, 2, 3, 4];



  // const handlerButton = () => {
  //   const user = new User();
  //   user.data.first_name = user1?.data.first_name;
  //   setUser1(user);
  //   console.log("Clicked");
  // }


  return (
    <>
    <br></br>
    <div className="App">
      User: <UserComponent user={user1}></UserComponent>
    </div>
    <br></br>
    <div className="App">
      User Not Found:<UserComponent user={user2}></UserComponent>
    </div>
    <br></br>
    <div className="App">
      Resourse:<UnknownComponent unkmown={unknown1}></UnknownComponent>
    </div>
    <br></br>
    <div className="App">
      Resourse Not Found:<UnknownComponent unkmown={unknown2}></UnknownComponent>
    </div>
    <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src={user1?.data.avatar} />
  <Card.Body>
    <Card.Title>{user1?.data.first_name}</Card.Title>
  </Card.Body>
</Card>
<ListComponent numbers={arr}></ListComponent>
  </>
  );
}


export default App;
